class ThemeifyTheme{constructor(e){this.elements=e}applyTheme(e){localStorage.setItem("ThemeifyTheme",e);for(let t=0;t<this.elements.length;t++){const o=this.elements[t];var s=document.querySelectorAll(o.selector);for(let t=0;t<s.length;t++)s[t].style.cssText+="light"==e?o.customCss.light:o.customCss.dark}}}class ThemeifyElement{constructor(e,s){this.selector=e,this.customCss=s}}class ThemeifyCss{constructor(e,s){this.light=e,this.dark=s}}var sampleTheme=new ThemeifyTheme([new ThemeifyElement("body",new ThemeifyCss("background-color: #ffffff; color: #000000;","background-color: rgb(0, 1, 87); color: #c7c5ff;")),new ThemeifyElement("button",new ThemeifyCss("background-color: #c7c5ff; color: #ffffff;","background-color: #c7c5ff; color: rgb(0, 1, 87);"))]);